            setData(result);

        } catch (error) {
            console.log(error)
        }
    }


    return (
        <div className='page'>
            <div className='container'>
                <div className='row'>
                    <div className='search-container'>
                        <input
                            type="text"
                            name="query"
                            className='search-input'
                            placeholder="Search username..."


                        />
                        <button onClick={handleClick} className='search-button'>Serach</button>


                    </div>

                </div>
            </div>
        </div >
    );
};

export default Home;
